import React from 'react'; 
import TextareaAutosize from '@material-ui/core/TextareaAutosize';
import IconButton from '@material-ui/core/IconButton';
import PhotoCamera from '@material-ui/icons/PhotoCamera';
import Button from '@material-ui/core/Button';
import CardMedia from '@material-ui/core/CardMedia'; 

import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import Avatar from '@material-ui/core/Avatar';
import MoreVertIcon from '@material-ui/icons/MoreVert';  
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({ 
    media: {
      height: 0,
      paddingTop: '56.25%', // 16:9
    }
}));
const dummy={
    isLoggedIn:true,
    imagePaths:[],
    mainFeeds:[{
        User:{
            id:1,
            nickname:'정하',
        },
        content:'주말인데 비가오네요. 파전이 생각납니다.',
        img:'http://localhost:3000/img/zeon.jpg'
    }]
}
const Home = () =>{
    const classes = useStyles();
    return(
        <> 
            {dummy.isLoggedIn && 
            <form encType="multipart/form-data">
                <TextareaAutosize aria-label="" centered
                rowsMin={9} style={{width:600}} placeholder="오늘 하루는 어땠나요?" />      
                <input type="file" multiple hidden />
                <IconButton color="primary" aria-label="upload picture" component="span">
                    <PhotoCamera />
                </IconButton> 
                <Button color="primary" style={{float:'right'}}>
                올리기</Button>
                {dummy.imagePaths.map( (v,i)=>{
                    return(
                    <><CardMedia 
                    image={"http://localhost:3000/"+v} alt={v}
                    /><Button>제거</Button>
                    </>
                    )
                })} 
            </form>}

            {dummy.mainFeeds.map( (c)=>{
                return(
                    <>
                    <CardHeader
                        avatar={<Avatar aria-label={c.User.nickname[0]}></Avatar>}
                        action={<IconButton aria-label="settings">
                            <MoreVertIcon /></IconButton>}
                        title={c.User.nickname}
                        subheader={c.User.content}
                    />
                    <CardMedia 
                    className={classes.media}
                    image={c.img} 
                    />
                    </>
                );
            })}
        </>
    )
}

export default Home;
